class Solution:
    def maxOperations(self, s: str) -> int:
        n = len(s)
        c = 0
        res = 0
        p = False
        for i in range(n):
            if s[i] == '1':
                p = False
                c += 1
            else:
                if p == False:
                    res += c
                    p = True

        return res
